import { Outlet } from "react-router-dom";
import AccountButton from "./AccountButton";
import PropTypes from 'prop-types';

const NavBar = ( { token, avatar, username } ) => {

    const navStyle = {
      position: "sticky",
      top: 0,
      color: "black",
      backgroundColor: "white",
      padding: "10px",
      fontFamily: "Sans-Serif",
    };
    
    const logoStyle = {
      maxHeight: "40px"
    };
    
    const accountNavStyle = {
      float: "right",
      verticalAlign: "center"
    }

    return (

      <>
        <nav style = {navStyle} id = "navbar">
          <img alt = "App Logo" src = "./images/logoImersi.png" style = {logoStyle}/>
          <div style = {accountNavStyle}>
            <AccountButton token = {token} avatar = {avatar} username = {username} />
          </div>
        </nav>

        <Outlet />
      </>

    );
  };
  
export default NavBar;  

NavBar.propTypes = {
  token: PropTypes.string.isRequired,
  avatar: PropTypes.string.isRequired, 
  username: PropTypes.string.isRequired
}
